css:
.editor-colors {
  background-color: #1a1a1a;
  color: #ecf0f1;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #e74c3c;
}
.editor .gutter {
  background-color: #2a2a2a;
}
.editor .gutter .line-number {
  opacity: 1;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #9b59b6;
}
.editor .cursor {
  border-color: #fdf6e3;
}
.editor .selection .region {
  background-color: #2a2a2a;
  color: #1a1a1a;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #e74c3c;
  color: white;
}
.bracket-matcher {
  background-color: #93a1a1;
  opacity: 0.7;
}
.comment {
  color: #606060;
  font-style: italic;
}
.entity {
  color: #2ecc71;
}
.keyword {
  color: #e74c3c;
}
.any-method {
  color: #3498db;
}
.storage.type {
  color: #3498db;
}
.storage.modifier {
  color: #e74c3c;
}
.constant {
  color: #6c71c4;
}
.constant.numeric,
.constant.boolean {
  color: #2ecc71;
}
.variable {
  color: #fff;
}
.delimiter,
.brace {
  color: #ecf0f1;
}
.delimiter.period {
  color: #2ecc71;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #e74c3c;
}
.invalid.illegal {
  color: #e74c3c;
}
.string {
  color: #f1c40f;
}
.string .constant.character.escape {
  color: #e74c3c;
}
.string.regexp {
  color: #3498db;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #e74c3c;
}
